import { createSlice } from '@reduxjs/toolkit'

const initialState = {
  value: 0,
}

export const numOfQuestion_slice = createSlice({
  name: 'numOfQuestion',
  initialState,
  reducers: {
    increment: (state) => {
      state.value += 1
    },
  },
})

// Action creators are generated for each case reducer function
export const { increment } = numOfQuestion_slice.actions

export default numOfQuestion_slice.reducer
